import React from 'react'

const projects=[
  {name:"API Development in C++",
    image:"https://assets-global.website-files.com/6228e4b0518bd64c391affa4/622902d6c427f74b6db921e1_catalog-lyft.gif",
    link:"",
    used:"C++ Libraries"
  },
  {name:"API Development in C++",
  image:"https://assets-global.website-files.com/6228e4b0518bd64c391affa4/622902d6c427f74b6db921e1_catalog-lyft.gif",
  link:"",
  used:"C++ Libraries"
},
{name:"API Development in C++",
image:"https://assets-global.website-files.com/6228e4b0518bd64c391affa4/622902d6c427f74b6db921e1_catalog-lyft.gif",
link:"",
used:"C++ Libraries"
},
{name:"API Development in C++",
image:"https://assets-global.website-files.com/6228e4b0518bd64c391affa4/622902d6c427f74b6db921e1_catalog-lyft.gif",
link:"",
used:"C++ Libraries"
},
];
export default function projectslist() {
  return (
    <div className='flex justify-around'>
      {projects.map((ele)=>{
        return(
          <div className='border border-8 border-[#fef0cc] border-double bg-black w-72 '>
          <img src={ele.image} alt=""/>
          <h1 >{ele.name}</h1>
          <p>{ele.used}</p>

          </div>
        )
      })
      }
    </div>
  )
}
